import React from 'react';
import '../App.css';

function Sustainability() {
  return (
    <div className="container" style={{ padding: '20px' }}>
      <h1>Sustainability</h1>
      <section className="section">
        <h2>Our Commitment</h2>
        <p>
          At Shundao, sustainability is at the core of our business. We invest in clean energy, reduce carbon emissions,
          and utilize innovative recycling and water-saving technologies.
        </p>
      </section>
      <section className="section">
        <h2>Green Initiatives</h2>
        <p>
          Learn about our renewable energy projects and eco-friendly production methods that drive positive environmental change.
        </p>
        {/* 可在此预留图表或数据可视化区域 */}
      </section>
    </div>
  );
}

export default Sustainability;
